import { recordValues } from "./FormattedData";

const RecordPopup = ({ onClose }) => {
    
    return (
        <div className="overlay">
            <div className="popup-container">
                <button className="popup-button" onClick={onClose}>
                    Close
                </button>
            </div>
        </div>
    );
};

export default RecordPopup;
